import styled from "styled-components";

export const WeekDayComponentButtonStyle = styled("button")`
  display: flex;
  align-items: flex-start;

  width: 164.85px;
  height: 102px;
  border: none;
  box-radius: 15px;
`;

export const Text = styled("div")`
  display: flex;

  align-items: center;
  font-style: normal;
  font-weight: 700;
  font-size: 20px;

  color: rgba(0, 0, 0, 0.75);
`;
